          "404": {
            "description": "Requested user or project doesn\u0027t exist or the user doesn\u0027t have enough permissions (i.e. project is hidden from the current user)",
            "content": {
              "*/*": {
                "schema": {
                  "type": "string",
                  "enum": [
                    "ADMIN",
                    "NONE",
                    "OWNER",
                    "SUPER_ADMIN",
                    "VIEWER"
                  ]
